class Register extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        username: '',
        email: '',
        password: '',
        confirmPassword: '',
      }
      this.handleChange = this.handleChange.bind(this);
      this.handleSubmit = this.handleSubmit.bind(this);
    }
    handleChange = (e) => {
      const {name, value} = e.target;
      this.setState({
        [name]: value
      });
    }
    handleSubmit = (e) => {
      e.preventDefault();
    }
